.component-date-time {
	color: #666;
	display: inline-block;
	position: relative;

	input {
		border: 1px solid rgb(254, 247, 229);
		border-radius: 4px;
		box-sizing: border-box;
		line-height: 1.125;
		outline: none;
		padding: 6px 24px 6px 12px;
		transition: 
			border-color 0.2s ease-in-out,
		;

		&:focus {
			border-color: rgb(246, 191, 38);
		}
	}

	&::after {
		content: "...";
		display: block;
		line-height: 1.125;
		padding: 6px 0;
		position: absolute;
			top: 1px;
			right: 0;
		text-align: center;
		width: 24px;
	}
}

.component-calendar {
	background-color: #fff;
	border: 1px solid rgb(246, 191, 38);
	border-radius: 4px;
	box-shadow: 0 1px 2px rgba(0, 0, 0, 0.15);
	padding: 0;
	position: absolute;
	top: 31px;
	width: auto;

	ul.calendar-head {
		border: 0 solid rgb(254, 247, 229);
		border-width: 0 0 1px;
		display: flex;
		font-size: 0;
		line-height: 44px;
		list-style: none;
		margin: 0;
		padding: 0;

		li {
			display: inline-block;
			flex: 1 0 auto;
			font-size: 14px;
			text-align: center;

			&.prev {
				align-self: flex-start;
			}

			&.next {
				align-self: flex-end;
			}

			&.prev,
			&.next {
				max-width: 44px;
			}

			button {
				background: transparent;
				border: none;
				cursor: pointer;
				display: block;
				font-weight: bold;
				line-height: inherit;
				margin: 0;
				outline: none;
				width: 100%;

				&:hover {
					background-color: rgb(254, 247, 229);
				}
			}
		}
	}

	ul.calendar-days {
		border: 0 solid rgb(254, 247, 229);
		border-width: 0 0 1px;
		display: flex;
		font-size: 0;
		line-height: 2;
		list-style: none;
		margin: 0;
		padding: 0;

		li {
			flex: 1 0 auto;
			font-size: 14px;
			text-align: center;
			user-select: none;
			width: 44px;
		}
	}

	ul.calendar-dates {
		font-size: 0;
		line-height: 2;
		list-style: none;
		margin: 0;
		padding: 0;

		li {
			cursor: pointer;
			display: inline-block;
			font-size: 14px;
			height: 44px;
			line-height: 44px;
			position: relative;
			text-align: center;
			user-select: none;
			width: 44px;

			&.selected {
				background: linear-gradient(
					135deg,
					transparent 25%,
					 rgb(254, 247, 229) 100%
				);
				color: #333;

				&::after{
					border: 6px solid transparent;
					border-right-color: rgb(246, 191, 38);
					border-bottom-color: rgb(246, 191, 38);
					content: "";
					display: block;
					height: 0;
					position: absolute;
						right: 0;
						bottom: 0;
					width: 0;
				}
			}

			&.not-this-month {
				color: #ededed;
			}

			&:hover {
				background-color: rgb(254, 247, 229);
				color: #666;
			}
		}
	}
}
